import React from 'react';
import '../../../../scss/utils/_all.scss';
import '../../../../scss/app/_header.scss';

export default function Header() {
    return (
        <div className='headerWrap col-lg-12'>
            <div className='headerLogo'><h1>
<span id="first">Zaplanuj</span>
<span id="second">Jedzonko</span>
</h1></div>
        </div>
    )
}
